      "fullDescription": "On the occasion of May Day (Labour Day), Kodai Charitable Foundation organised a heartfelt Thanksgiving Event for the sanitation workers of West Mambalam, honouring their vital contribution in keeping our city clean and healthy. The event was presided over by Shri H. Raja, Senior BJP Leader and Councillor Smt. Uma Anandan. Shri. H. Raja appreciated the selfless service rendered by the conservancy staff and stressed the key role played by them in the Honorable PM Vision of Swachh Bharath.  As a token of gratitude, the Foundation distributed 5 kg rice bags and provided breakfast and refreshments to over 70+ sanitation workers",
